import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './Profile.css';

const Profile = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [gender, setGender] = useState('');
  const [dob, setDob] = useState('');
  const [image, setImage] = useState(null);
  const [profileData, setProfileData] = useState(null);
  const navigate = useNavigate();

  // Fetch profile data from the backend when the component is mounted
  useEffect(() => {
    axios.get('/api/profile')
      .then((response) => {
        const { name, email, gender, dob, image } = response.data;
        setProfileData(response.data);
        setName(name || '');
        setEmail(email || '');
        setGender(gender || '');
        setDob(dob || '');
        setImage(image || null);
      })
      .catch((err) => {
        console.error('Error fetching profile data:', err);
      });
  }, []);

  // Handle form input change
  const handleNameChange = (e) => setName(e.target.value);
  const handleEmailChange = (e) => setEmail(e.target.value);
  const handleGenderChange = (e) => setGender(e.target.value);
  const handleDobChange = (e) => setDob(e.target.value);
  const handleImageChange = (e) => setImage(e.target.files[0]);

  // Handle form submission
  const handleSave = async () => {
    const formData = new FormData();
    formData.append('name', name);
    formData.append('email', email);
    formData.append('gender', gender);
    formData.append('dob', dob);
    if (image) formData.append('image', image);

    try {
      await axios.post('/api/profile', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });
      alert('Profile saved successfully!');
    } catch (error) {
      console.error('Error saving profile:', error);
    }
  };

  const goToTravelHistory = () => {
    navigate('/travel-history');
  };

  return (
    <div className="profile-page">
      <h2>MY PROFILE</h2>
      <div className="profile-container">
        <div className="profile-info">
          <label>Name:</label>
          <input type="text" value={name} onChange={handleNameChange} placeholder="Enter your name" />

          <label>Email:</label>
          <input type="email" value={email} onChange={handleEmailChange} placeholder="Enter your email" />

          <label>Gender:</label>
          <select value={gender} onChange={handleGenderChange}>
            <option value="">Select Gender</option>
            <option value="male">Male</option>
            <option value="female">Female</option>
            <option value="other">Other</option>
          </select>

          <label>Date of Birth:</label>
          <input type="date" value={dob} onChange={handleDobChange} />

          <button className="travel-history-btn" onClick={goToTravelHistory}>Travel History</button>
          <button className="save-btn" onClick={handleSave}>Save</button>
        </div>

        <div className="profile-photo-section">
          <div className="profile-photo-placeholder">
            {/* Display the saved profile photo */}
            {profileData && profileData.image && (
              <img src={`/uploads/${profileData.image}`} alt="Profile" className="profile-photo" />
            )}
          </div>
          <input type="file" onChange={handleImageChange} />
          <button className="edit-photo-btn">Edit</button>
        </div>
      </div>
    </div>
  );
};

export default Profile;
